import {useState} from 'react';
import saveIcon from './assets/save.png';
import './css/Note.css';

function Modal({open}){
    if (!open) {
        return null;
    }
    return (
        <div className='overlay'>
            <div className='modal'>
                <div className='entry'> 
                    Title: 
                    <span> 
                        <input placeholder="Type something..." 
                        maxlength="40">
                        </input>
                    </span>
                </div>
            </div>
        </div>
    );
}

export default Modal;
